import React from 'react';
import './HomepageHeader.css';

const HomepageHeader = () => {
  return (
    <div class="title-text-container" style={ { zIndex:999,  color:'white' } }>
      <h1 style={{fontWeight:'normal'}}>Hello, I'm <span style={{ color:'orange'}}>Sol Abrahams.</span></h1>
      <hr />
      <h3 style={ { fontWeight:'normal'} }>I'm a student with a passion for<br />programming and problem solving.</h3>
      <button class="find-out-more">
        <p style={{display: 'inlineBlock', margin:'auto', fontSize:20}}>Find out more</p>
        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-arrow-right rotate-arrow"><line x1="5" y1="12" x2="19" y2="12"></line><polyline points="12 5 19 12 12 19"></polyline></svg>
     </button>
   </div>
  )
}

export default HomepageHeader;
